function fearNotLetter(str) {
  // get the ASCII values of the first and the last character
  let codeFirst  = str.charCodeAt(0);
  let codeLast  = str.charCodeAt(str.length-1);

  // loop through the range of the ASCII characters
  for(let i = codeFirst; i <= codeLast; i++){
    // if some of them are not in the original str return it
    if(str.indexOf(String.fromCharCode(i)) === -1){
      return String.fromCharCode(i);
    }
  }
  // in case the str is a complete range return undefined
  return undefined;
}

